//CADA REDUCER TIENE SU PROPIO STATE
//IMPORTANDO TYPES
import { REGISTRO_EXITOSO, REGISTRO_ERROR, LIMPIAR_ALERTA } from "../types";

const initialState = {
  accessToken: null,
  usuario: null,
};

export default function (state = initialState, action) {
  switch (action.type) {
    default:
      return state;
  }
}
